import Button from "@mui/material/Button";
import styled from "styled-components";

const ButtonStyle = styled.div

const ButtonForm = (props) => {
  return (
    <div className="button">
      <Button
        variant="contained"
        style={{ width: "15%", margin: "auto" }}
      >
        {props.title}
      </Button>
    </div>
  );
};

export default ButtonForm;
